  function waitForGlobal(varName, cb) {
    const start = Date.now();
    const timer = setInterval(() => {
      const value = window[varName];
      if (value) {
        clearInterval(timer);
        cb(value);
        return;
      }
      if (Date.now() - start > 15000) {
        clearInterval(timer);
        console.warn("Timed out waiting for global:", varName);
      }
    }, 100);
  }

  function ensureElevationPluginReady(cb) {

        console.warn("Leaflet.Elevation not ready. Check if scripts loaded (d3 / geometryutil / leaflet-elevation).");
